import { StyledDropdownMenu } from './styles/DropdownMenu.styled';

const DropdownMenu = () => {
  return (
    <StyledDropdownMenu>
      <span>프로필 관리</span>
      <span>프로필에서 나가기</span>
    </StyledDropdownMenu>
  );
};

export default DropdownMenu;
